r($,"aBG","Qo",()=>A.a([A.a_O("Saurabh Keskar","January 15, 2023","I recently discovered Mocha Shoes while searching for a specific Formal shoe. Not only did they have the item I was looking for, but their selection was vast, and the prices were competitive. The website was easy to navigate, and the product descriptions were informative and accurate. I was pleasantly surprised by the fast shipping and the care they took in packaging my order. I'm thrilled with my purchase and will continue to shop at Mocha Shoes for all my Formal Footwears needs.",5),A.a_O("Rajiv Satyanarayana","March 10, 2023","I ordered a Leather Sneekers from Mocha Shoes last week, and I was amazed at how quickly it arrived. The packaging was secure, ensuring the item was undamaged. The customer service was exceptional, as they kept me updated throughout the entire process. I had a question about the product, and their support team responded promptly and professionally. Overall, my experience with [Mocha Shoes] was outstanding, and I can't wait for my next purchase.",4),A.a_O("Deepanshu Singhal","May 25, 2023","I got a pair of boots from Mocha Shoes and I'm very satisfied. They are high-quality and worth the money. The store also offered free shipping at that price so that's a plus!",5),A.a_O("Amit Singh","Jun 5, 2023"," recently purchased a Leather shoes from Mocha Shoes. The quality of the product was excellent, and the packaging ensured that it survived the transportation. The ordering process was quite smooth, can't wait to shop here again.",5)],A.a2("w<Gu>")))
